class Solution {
public:
    ListNode *tail(ListNode *head) {
        auto cur=head;
        while(cur && cur->next) cur=cur->next;
        return cur;
    }
    ListNode *quickSort(ListNode *head) {
        if(head==nullptr || head->next==nullptr) return head;
        
        ListNode *pivotptr = head, *cur;
        int pivot=pivotptr->val;
        
        // cout<<"pivot: "<<pivot<<endl;

        ListNode less(0), more(0); 
        ListNode *l=&less, *m=&more;
        for(cur=head->next; cur; cur=cur->next) {
            if(cur->val < pivot) {
                l->next = cur;
                l = l->next;
            }
            else {
                m->next = cur;
                m = m->next;
            }
        }
        l->next = m->next = nullptr;

        // cout<<"less: ";
        // less.next->show();
        // cout<<"more: ";
        // more.next->show();

        l = quickSort(less.next);
        if(l)
            tail(l)->next = pivotptr;
        else l = pivotptr;
        pivotptr->next = quickSort(more.next);
        return l;
    }
    ListNode *sortList(ListNode *head) {
        return quickSort(head);
    }
};
